import React from 'react';
import { user } from '../../actions/user';
import { useDispatch } from 'react-redux';


export default function Navbar() {
    const dispatch = useDispatch();
    return (
        <div className='Navbar' onClick={() => dispatch(user())}>
            Navbar
        </div>
    )
}
